            <div class="view-header">
      <p>General Orders regulating current court operations are listed below, with a drop-down filter available to sort by category. The link on the left menu will provide the current General Orders in numeric order.</p>
<p>The “Archived General Orders” link provides access to all other General Orders available in electronic form, including many that are superseded, rescinded, or otherwise of only historical interest. Many older General Orders are not available in electronic form at this time; copies of all General Orders are maintained in the Office of the Clerk of Court pursuant to Local Rule 1-2.</p>
<p>Index links in numerical order and by subject include both operative and archived General Orders.</p>
<hr />    </div>
  
